import React, { useState } from "react";
import {
  Container,
  TextField,
  Button,
  Typography,
  Card,
  CardContent,
  CircularProgress,
  Alert,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
} from "@mui/material";
import { Bolt, CheckCircle } from "@mui/icons-material";

function App() {
  const [product, setProduct] = useState("");
  const [features, setFeatures] = useState("");
  const [audience, setAudience] = useState("");
  const [tagline, setTagline] = useState("");
  const [alternatives, setAlternatives] = useState([]);
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  const handleGenerate = async () => {
    setError("");
    setTagline("");
    setAlternatives([]);
    setLoading(true);

    try {
      const response = await fetch("http://localhost:5000/generate", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ product, features, audience }),
      });

      if (!response.ok) {
        const errData = await response.json();
        throw new Error(errData.error || "Something went wrong!");
      }

      const data = await response.json();
      setTagline(data.tagline);
      setAlternatives(data.alternatives || []);
    } catch (err) {
      setError(`⚠️ ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="sm" sx={{ mt: 5 }}>
      <Typography
        variant="h4"
        align="center"
        gutterBottom
        sx={{ fontWeight: "bold" }}
      >
        ⚡ AI Tagline Generator
      </Typography>

      <Card sx={{ p: 3, borderRadius: 3, boxShadow: 4 }}>
        <CardContent>
          <TextField
            label="Product Name"
            variant="outlined"
            fullWidth
            margin="normal"
            value={product}
            onChange={(e) => setProduct(e.target.value)}
          />
          <TextField
            label="Key Features"
            variant="outlined"
            fullWidth
            margin="normal"
            value={features}
            onChange={(e) => setFeatures(e.target.value)}
          />
          <TextField
            label="Target Audience"
            variant="outlined"
            fullWidth
            margin="normal"
            value={audience}
            onChange={(e) => setAudience(e.target.value)}
          />

          <Button
            variant="contained"
            color="primary"
            fullWidth
            sx={{ mt: 2, py: 1.2, fontSize: "16px", fontWeight: "bold" }}
            onClick={handleGenerate}
            disabled={loading}
            startIcon={<Bolt />}
          >
            {loading ? <CircularProgress size={24} color="inherit" /> : "Generate Tagline"}
          </Button>

          {error && (
            <Alert severity="error" sx={{ mt: 2 }}>
              {error}
            </Alert>
          )}

          {tagline && (
            <Card sx={{ mt: 3, p: 2, backgroundColor: "#f5f5f5" }}>
              <Typography variant="h6" gutterBottom>
                Main Tagline
              </Typography>
              <Typography variant="body1" sx={{ fontStyle: "italic" }}>
                "{tagline}"
              </Typography>

              {alternatives.length > 0 && (
                <>
                  <Typography
                    variant="subtitle1"
                    sx={{ mt: 2, fontWeight: "bold" }}
                  >
                    Other Suggestions
                  </Typography>
                  <List>
                    {alternatives.map((alt, idx) => (
                      <ListItem key={idx}>
                        <ListItemIcon>
                          <CheckCircle color="success" />
                        </ListItemIcon>
                        <ListItemText primary={alt} />
                      </ListItem>
                    ))}
                  </List>
                </>
              )}
            </Card>
          )}
        </CardContent>
      </Card>
    </Container>
  );
}

export default App;
